import classes from "./AddUser.module.css";
import Card from "../ui/card/Card";

export default function AddUser(props) {
  return (
    <Card className={classes.box}>
      <label>
        Name
        <input
          type="text"
          placeholder="Hisham Sakr"
          id="user-name"
          name="user-name"
        />
      </label>

      <label>
        Age (in years) <input type="number" placeholder="40" name="user-age" />
      </label>
    </Card>
  );
}
